description:
If you need to hire a trainer, you might as well take on the hottest one around, Liza Del Sierra. She's the personal trainer to the stars, and a perfect fit for her new client, one of the biggest names in hop hop. The only problem is he isn't interested in squats, lunges, or jumping jacks. It's smooth sailing, once Liza realizes that dude wants to work up a sweat pounding the fuck out of her thick ass. 


